  public userInfo: any = {};

  constructor(private http: HttpClient, private router: Router) {}

  ngOnInit(): void {
    this.getUserDetails();
  }
  ngAfterViewInit(): void {}

  getUserDetails() {
    userDetails().then((res: any) => {
      this.userInfo = res;
    });
  }

  public onToolbarClick(args: ToolbarClickEventArgs): void {
    switch (args.item.id) {
      case 'Approve Document':
        this.onApproveDocument();
        break;
      case 'Save Document':
        // this.container.documentEditor.getd
        this.onSaveDocument();
        break;
    }
  }

  private onWrapText(text: string): string {
    let content: string = '';
    const index: number = text.lastIndexOf(' ');

    if (index !== -1) {
      content =
        text.slice(0, index) +
        "<div class='e-de-text-wrap'>" +
        text.slice(index + 1) +
        '</div>';
    } else {
      content = text;
    }

    return content;
  }

  onCreated() {
    //Specifies the language id to map server side dictionary.
    this.container.documentEditor.spellChecker.languageID = 1033;
    this.container.documentEditor.spellChecker.removeUnderline = false;
    this.container.documentEditor.spellChecker.allowSpellCheckAndSuggestion =
      true;
    // this.container.documentEditor.open(this.getSFDT().content);
  }
  // Function to handle saving the document
  public onSaveDocument(): void {
    const editor = this.container.documentEditor;
    const documentData = editor.serialize();
    const payload = {
      fileName: 'MyDocument.docx',
      content: documentData,
    };
    this.http
      .post(this.container.serviceUrl + 'Save', payload, {
        headers: {
          Authorization: `Bearer ${environment.syncfusionLicenseKey}`,
        },
        responseType: 'text',
      })
      .subscribe(
        (sfdt: string) => {
          alert('Document Saved!');
        },
        (error: any) => {
          console.error('Error during conversion:', error);
          if (error.status === 0) {
            console.error('Network error or CORS issue');
          } else {
            console.error('API error:', error.status, error.message);
          }
        }
      );
  }
  // Function to handle approval process
  public async onApproveDocument() {
    // if (this.container && this.container.documentEditor) {
    //   const editor = this.container.documentEditor;
    //   const userName = 'John Doe'; // Replace with logged-in user name dynamically
    //   const date = new Date().toLocaleDateString();

    //   const approvalText = `Approved by: ${userName} on ${date}`;

    //   // Move cursor to the top-right of the first page
    //   editor.selection.moveToDocumentStart();
    //   editor.editor.insertText(approvalText);
    //   editor.editor.insertText('\n'); // New line after approval text
    // }
    const editor = this.container.documentEditor;

    // Convert document to Blob (DOCX format)
    const blob = await editor.saveAsBlob('Docx');

    // Convert Blob to File (Required for FormData)
    const file = new File([blob], 'document.docx', {
      type: 'application/vnd.openxmlformats-officedocument.wordprocessingml.document',
    });
    let formdata = new FormData();
    formdata.append('files', file);
    formdata.append('approverName', this.userInfo.userName);

    this.http
      .post(this.container.serviceUrl + 'appendSignature', formdata, {
        headers: {
          Authorization: `Bearer ${environment.syncfusionLicenseKey}`,
        },
        responseType: 'text',
      })
      .subscribe(
        (sfdt: string) => {
          this.container.documentEditor.open(sfdt);
        },
        (error: any) => {
          console.error('Error during conversion:', error);
          if (error.status === 0) {
            console.error('Network error or CORS issue');
          } else {
            console.error('API error:', error.status, error.message);
          }
        }
      );
  }

